script: |
  super -f tsv -I q9384.sql | sort > q9384.out

vector: true

inputs:
  - name: q9384.sql
    data: |
      SELECT - col0 FROM tab0 GROUP BY col1, col0, col2 HAVING 61 NOT IN ( + - CASE - col0 WHEN 62 + NULLIF ( - col2, col2 * + col0 ) THEN NULL WHEN col2 THEN NULL ELSE - col1 * col0 END );
  - name: tab0

outputs:
  - name: q9384.out
    data: |
      -26
      -43
      -83
